__author__ = 'user'

class Solution(object):
    def visit_neighbors(self, board, current, ochar, visited):
        x,y = current
        if x < 0 or y < 0 or x >= len(board) or y >= len(board[0]):
            return
        if visited[x][y]:
            return
        visited[x][y] = True

        if board[x][y] != ochar:
            return

        board[x][y] = '1'

        offsets = [(-1,0), (1,0), (0,-1), (0,1)]
        neighbors = [(x + x1, y + y1) for (x1,y1) in offsets]

        for neighbor in neighbors:
            self.visit_neighbors(board, neighbor, ochar, visited)


    def solve(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """

        xlen = len(board)
        if xlen <= 0:
            return

        ylen = len(board[0])
        if ylen <= 0:
            return

        isupper = board[0][0] == board[0][0].upper()
        ochar = 'O' if isupper else 'o'
        xchar = 'X' if isupper else 'x'


        edges = [(0,y) for y in range(ylen)] + \
                [(xlen-1,y) for y in range(ylen)] + \
                [(x,0) for x in range(xlen)] + \
                [(x,ylen-1) for x in range(xlen)]

        edges_set = set(edges)

        visited = [[False] * ylen for i in range(xlen)]

        for edge in edges_set:
            self.visit_neighbors(board, edge, ochar, visited)

        # print(board)

        for i in range(len(board)):
            for j in range(len(board[0])):
                if board[i][j] == '1':
                    board[i][j] = ochar
                elif board[i][j] == ochar:
                    board[i][j] = xchar


def trans(board):
    return [[c for c in line] for line in board]

a = Solution()
board = trans(['xxxx', 'xoox', 'xxox', 'xoxx'])
print(board)
a.solve(board)
print(board)

